"""Diseñe una función que calcule la cantidad de carne de aves en kilos si se tienen N gallinas, M gallos y K pollitos cada uno pesando 6 kilos, 7 kilos y 1 kilo respectivamente.


"""

n : int
m : int
k : int
n = int(input("Ingrese cuantas gallinas tiene: "))
m = int(input("Ingrese cuantos gallos tiene: "))
k = int(input("Ingrese cunatos pollitos tiene: "))
def kilos (n,m,k):
  return (n*6)+(m*7)+(k*1)
print(kilos(n,m,k))

